import React from 'react';

const AboutPage = () => {
  return (
    <div>
      <header>
        <h1>About Us</h1>
      </header>
      <main>
        <p>
          Welcome to our 'About Us' page! Here, you can learn more about our team,
          mission, and values.
        </p>
        <img
          src="https://example.com/images/about-us-image.jpg"
          alt="About Us Image"
        />
      </main>
    </div>
  );
};

export default AboutPage;
